  </thead>
  <tbody>
    <tr>
      <td>1</td>
      <td>Mark</td>
    </tr>
    <tr>
      <td>2</td>
      <td>Jacob</td>
    </tr>
  </tbody>
</Table>
    	</form>
    );
  }
}

